import frame11Img1 from '../assets/img/frame11/frame11Img1.png'
const frame11 = [
    {
        frame11Title: [
            {
                id: 0,
                text: 'по версии отдыхающих'
            },
            {
                id: 1,
                text: 'Популярные направления'
            }
        ],
        frame11Img: [
            {
                id: 0,
                img: 'sadasd'
            }
        ]
    }
]
